import React from 'react'
import Cards from '../Cards/Cards'
import s from '../CardsContainer/style.module.css'

export default function CardsContainer({cards, deleteCard, change_to_card }) {
  return (
    <div className={s.cards_container}> 
      {
      cards.map(el => <Cards key={el.id} {...el} {...{deleteCard, change_to_card }}/>)
      }
    </div>
  )
}
